import { useEffect } from "react";
import Crown from '@govuk-react/icon-crown';
import LoginForm from "../Components/LoginComponents/LoginForm";
import Navigation from "../Components/Navigation";
import govukReactCaption from "@govuk-react/caption";
function Login() {

  useEffect(() => {
    
    const title = 'Log in';
    document.title = `${<Crown />} ${title}`;
  })

  return (
    <>
    <Navigation
        pageLink1="/"
        PageName1="home"
        pageLink2="/login"
        PageName2="Login"
        pageLink3="/NhsNumber"
        PageName3="Register"
      />
      <LoginForm />
    </>
  );
}

export default Login;
